import React, { useState } from 'react';
import { MapContainer, TileLayer, Marker, Popup, Polyline } from 'react-leaflet';
import './RoutePlanning.css';

// Fix for leaflet icons
import L from 'leaflet';
delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: require('leaflet/dist/images/marker-icon-2x.png'),
  iconUrl: require('leaflet/dist/images/marker-icon.png'),
  shadowUrl: require('leaflet/dist/images/marker-shadow.png'),
});

const RoutePlanning = () => {
  const [fromLocation, setFromLocation] = useState('Chennai');
  const [toLocation, setToLocation] = useState('Salem');
  const [routeData, setRouteData] = useState({
    distance: 347,
    duration: 285,
    coordinates: [
      [13.0827, 80.2707], // Chennai
      [11.6643, 78.1460]  // Salem
    ]
  });
  const [isLoading, setIsLoading] = useState(false);
  const [routeFound, setRouteFound] = useState(true);

  const handleFindRoute = async () => {
    if (!fromLocation || !toLocation) {
      alert('Please enter both locations');
      return;
    }

    setIsLoading(true);
    setRouteFound(false);
    
    // Simulate loading
    setTimeout(() => {
      // Simple hardcoded examples for demo
      if (fromLocation.toLowerCase().includes('chennai') && toLocation.toLowerCase().includes('salem')) {
        setRouteData({
          distance: 347,
          duration: 285,
          coordinates: [[13.0827, 80.2707], [11.6643, 78.1460]]
        });
      } else if (fromLocation.toLowerCase().includes('mumbai') && toLocation.toLowerCase().includes('pune')) {
        setRouteData({
          distance: 149,
          duration: 180,
          coordinates: [[19.0760, 72.8777], [18.5204, 73.8567]]
        });
      } else {
        // Default route for any other combination
        setRouteData({
          distance: 250,
          duration: 200,
          coordinates: [[13.0827, 80.2707], [11.6643, 78.1460]]
        });
      }
      setRouteFound(true);
      setIsLoading(false);
    }, 2000);
  };

  const handleStartNavigation = () => {
    if (routeData && routeData.coordinates) {
      const start = routeData.coordinates[0];
      const end = routeData.coordinates[routeData.coordinates.length - 1];
      const gmapsUrl = `https://www.google.com/maps/dir/?api=1&origin=${start[0]},${start[1]}&destination=${end[0]},${end[1]}`;
      window.open(gmapsUrl, "_blank");
    }
  };

  return (
    <div className="route-planning-container">
      <div className="planning-panel">
        <div className="header">
          <h1>SafePath AI</h1>
        </div>
        <div className="route-form">
          <h2>üó∫Ô∏è Route Planning</h2>
          
          <div className="input-group">
            <label>From</label>
            <input
              type="text"
              value={fromLocation}
              onChange={(e) => setFromLocation(e.target.value)}
              placeholder="Enter starting location"
              className="location-input"
            />
          </div>

          <div className="input-group">
            <label>To</label>
            <input
              type="text"
              value={toLocation}
              onChange={(e) => setToLocation(e.target.value)}
              placeholder="Enter destination"
              className="location-input"
            />
          </div>

          <button onClick={handleFindRoute} disabled={isLoading} className="find-route-btn">
            {isLoading ? 'üîÑ Finding Safe Route...' : 'üõ°Ô∏è Find Safe Route'}
          </button>

          {routeFound && routeData && (
            <div className="route-info">
              <div className="route-stats">
                <h3>‚úÖ Safe Route Found</h3>
                <div className="stats">
                  <div className="stat-item">
                    <span className="label">Distance:</span>
                    <span className="value">{routeData.distance} km</span>
                  </div>
                  <div className="stat-item">
                    <span className="label">Estimated Time:</span>
                    <span className="value">{Math.floor(routeData.duration / 60)}h {routeData.duration % 60}m</span>
                  </div>
                  <div className="stat-item">
                    <span className="label">Safety Score:</span>
                    <span className="value safe">92%</span>
                  </div>
                  <div className="stat-item">
                    <span className="label">Hazards Avoided:</span>
                    <span className="value">3</span>
                  </div>
                </div>
              </div>

              <div className="route-warnings">
                <h4>‚ö†Ô∏è Safety Alerts</h4>
                <div className="alert-item warning">
                  <span>üöß</span> Construction work possible on main highways
                </div>
                <div className="alert-item info">
                  <span>üåßÔ∏è</span> Check local weather for rain risks
                </div>
                <div className="alert-item success">
                  <span>‚úÖ</span> Route avoids major accident zones
                </div>
              </div>

              <button className="start-navigation-btn" type="button" onClick={handleStartNavigation}>
                üöó Start Navigation
              </button>
            </div>
          )}
        </div>
      </div>

      <div className="map-panel">
        <MapContainer 
          center={routeData.coordinates[0] || [13.0827, 80.2707]} 
          zoom={8} 
          style={{ height: "100%", width: "100%" }}
        >
          <TileLayer
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            attribution='&copy; OpenStreetMap contributors'
          />
          
          {routeData.coordinates && (
            <Marker position={routeData.coordinates[0]}>
              <Popup>Start: {fromLocation}</Popup>
            </Marker>
          )}
          
          {routeData.coordinates && (
            <Marker position={routeData.coordinates[routeData.coordinates.length - 1]}>
              <Popup>End: {toLocation}</Popup>
            </Marker>
          )}
          
          {routeData.coordinates && (
            <Polyline positions={routeData.coordinates} color="#4CAF50" weight={6} />
          )}
        </MapContainer>
      </div>
    </div>
  );
};

export default RoutePlanning;
